$().ready(function(){setMailTo();setExternalLinks();setClickOnce();jQuery.validator.methods.date=function(i,d){var c=false;var h=/^\d{1,2}\/\d{1,2}\/\d{4}$/;if(h.test(i)){var b=i.split("/");var f=parseInt(b[0],10);var g=parseInt(b[1],10);var a=parseInt(b[2],10);var j=new Date(a,g-1,f);if((j.getFullYear()==a)&&(j.getMonth()==g-1)&&(j.getDate()==f)){c=true}else{c=false}}else{c=false}return this.optional(d)||c}});function setMailTo(){$("a.email").each(function(){e=this.rel.replace("/","@");this.href="mailto:"+e;if($(this).text()==""){$(this).text(e)}})}function setExternalLinks(){$("a[rel=external]").click(function(){this.target="_blank"})}function setClickOnce(){$("form").submit(function(){$(this).find("input.clickOnce").attr("disabled","disabled")})};